export function rmReducer(state = initialState, action) {
  switch (action.type) {
    case "ADD_CHAR":
      return {
        ...state,
        chars: [...state.chars, action.data],
      };
    case "DELETE_CHAR":
      console.log("hello");
      console.log(action.data);
      const updatedArr = state.chars.filter((character) => {
        console.log(character);
        return character.id !== action.data;
      });
      return {
        ...state,
        chars: updatedArr,
      };
    case "GET_CHARS":
      return {
        ...state,
      };
    default:
      return state;
  }
}
